import React, {Component} from 'react';
import {Grid, Cell, DataTable} from 'react-mdl';

class LandingPage extends Component {
    render(){
        return(
            <div style ={{width:'100%' , margin: 'auto'}}>
                
                <Grid className="landing-grid">
            
                <Cell col={12}>
            
                <div className="banner-text">
                <h1> FSU Distribution Database</h1>
              

                </div>
                
                
                </Cell>
                
                </Grid>

                <Grid>
                    <Cell col={6}>
                        <h3>Data Table 1</h3>
                    
                    
                    </Cell>

                    <Cell col={6}>
                        <h3>Data Table 2</h3>
                        <DataTable
                            shadow ={0}
                            rows ={[
                                {Number: '200', Project: 'INVC', Season: '2005'}
                            ]}>
                            <TableHeader name="Number">Number</TableHeader>
                            <TableHeader name="Project">Project</TableHeader>
                            <TableHeader name="Season">Season</TableHeader>
                            </DataTable>


                    </Cell>

                </Grid>
            
            </div>
        )
    }
}

export default LandingPage;
